webpackJsonp([79384409576586],{306:function(a,e){a.exports={data:{markdownRemark:{html:'<hr>\n<p>Destructuring is a convenient way in Javascript to extract multiple values from data stored in Arrays and properties stored in Objects into distinct variables using a single line of assignment expression! </p>\n<p><strong>In short</strong>: <em>Use one assignment expression to assign all array / object data members to individual variables.</em> </p>\n<p>Big reason why you should learn and use ES6!</p>\n<p><em><strong>Quick Examples</strong></em></p>\n<p>: Arrays :</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsjavaascript"><code class="language-jsjavaascript">var exampleArray, a, b, c, d;\n\n// Array to multiple variables =&gt;\nexampleArray=[23, &#39;Hello&#39;, true, 0];\n[a, b, c, d] = exampleArray;\n\nconsole.log(a,b,c,d); // 23 &quot;Hello&quot; true 0\n\n// Or better still combine declaration &amp; assignment using this syntax =&gt;\nvar [a,b,c,d] = exampleArray;\n\nconsole.log(a,b,c,d); // 23 &quot;Hello&quot; true 0</code></pre>\n      </div>\n<p>: Objects :</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsjavascript"><code class="language-jsjavascript">let obj = { a: &#39;Hello&#39;, b: 14, c: true};\n\nlet {a,b,c} = obj; // destructuring the &#39;obj&#39; object\n\nconsole.log(a,b,c); // Hello 14 true</code></pre>\n      </div>',frontmatter:{date:"April 29, 2018",path:"/destructuring",title:"Destructuring in JS"}}},pathContext:{}}}});
